// Generate some test data
const items = [];
for (let i = 1; i <= 5; i++) {
  items.push({
    json: {
      id: i,
      message: `Hello from item ${i}`,
      timestamp: new Date().toISOString(),
      random: Math.floor(Math.random() * 1000)
    }
  });
}
return items;

// Count items and summarize
const count = $input.all().length;
const ids = $input.all().map(item => item.json.id);
return [{
  json: {
    status: 'success',
    itemCount: count,
    processedIds: ids,
    completedAt: new Date().toISOString()
  }
}];
